
        <html>
              <head>
                <style>
                  body{
                    font-family: monospace;
                    margin: 0;
                    background: #374151;
                    color: #eee;
                    padding: 10px;
                  }
                  #text_info{
                    width: 512px;
                    float: left;
                  }
                  #show_faworites{
                    display: inline-block;
                    width: 20px;
                    height: 20px;
                    font-size: 22px;
                    line-height: 20px;
                    color: faea0d;
                    cursor: pointer;
                  }
                  .info_area{
                    width: 768px;
                    height: 100px;
                    margin-top: 1px;
                  }
                  #change_thumb_size{
                    width: 512px;
                  }
                  #global_gallery{
                    background-color: #000;
                    width: 512px;
                    height: 768px;
                    overflow-y: scroll;
                  }                  
                  #global_gallery div{
                    width: 64px;
                    height: 64px;
                    margin: 2px;
                    cursor: pointer;
                    float: left;
                  }
                  #global_gallery div img{
                    max-width: 64px;
                    max-height: 64px;
                  }
                  #frame_counter{
                    display: inline-block;
                    width: 90px;
                    text-align: center;
                  }
                  #frame_per_second{
                    width: 50px;
                  }
                  #search_field{
                    width: 195px;
                  }
                  .display_div{
                    width: 768px;
                    height: 768px;
                    position: relative;
                    float: left;
                  }
                  .display_div_image {
                    width: 768px;
                    height: 486px;
                    float: left;
                    position: relative;
                  }
                  .display_div_image img{
                    max-width: 100%; 
                    max-height: 100%;
                    /* width: auto; */
                    /* height: auto; */
                    position: absolute;
                    left: 50%;
                    top:50%;
                    transform: translate( -50%, -50% );
                  }
                  #slide, #change_thumb_size{
                    user-select: none;
                  }
                </style>
              </head>

                  let searchEngine = null;

                  const setFrame = ( frameIndex, updateSlider ) => {

                  };

                        this.active = !this.active;

                          this.speed = $$('frame_per_second').value;
                          this.next();
                        } else {
                          this.stop();
                        }
                      },
                      framePrev: function(){
                        if( searchEngine.filtered[ CURRENT_FRAME - 1 ] ){
                            setFrame( CURRENT_FRAME - 1, true );
                        }
                      },
                      frameNext: function(){
                        if( searchEngine.filtered[ CURRENT_FRAME + 1 ] ){
                            setFrame( CURRENT_FRAME + 1, true );
                        }
                      },
                      next: function(){
                        this.speed = $$('frame_per_second').value;
                        const nextInterval = 1000 / this.speed;
                        this.player = setTimeout( () => {
                          if( CURRENT_FRAME + 1 < searchEngine.filtered.length ){
                            setFrame( CURRENT_FRAME + 1, true );
                            this.next();
                          } else {

                          }
                        }, nextInterval );
                      },
